rial\",\"sans-serif\"; mso-fareast-font-family:\"Times New Roman\";color:#263F97;mso-fareast-language: EN-IN\">We are partnered with trusted Transporters and logistics service providers. <o:p></o:p></span></b></p> <p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;line-height: 39.9pt;mso-outline-level:2\"><b><span style=\"font-size:12.0pt;font-family:\"Arial\",\"sans-serif\"; mso-fareast-font-family:\"Times New Roman\";color:#263F97;mso-fareast-language: EN-IN\">We try to serve you with the best lowest possible rates<o:p></o:p></span></b></p> <p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;line-height: 39.9pt;mso-outline-level:2\"><b><span style=\"font-size:12.0pt;font-family:\"Arial\",\"sans-serif\"; mso-fareast-font-family:\"Times New Roman\";color:#263F97;mso-fareast-language: EN-IN\">Â </span></b></p> <p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;line-height: 39.9pt;mso-outline-level:2\"><b><span style=\"font-size:12.0pt;font-family:\"Arial\",\"sans-serif\"; mso-fareast-font-family:\"Times New Roman\";color:#263F97;mso-fareast-language: EN-IN\">Â </span></b></p> <p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;line-height: 39.9pt;mso-outline-level:2\"><span style=\"font-size:12.0pt;font-family:\"Arial\",\"sans-serif\"; mso-fareast-font-family:\"Times New Roman\";color:#263F97;mso-fareast-language: EN-IN\">We are currently operational to almost 5000+ pin codes in India and continuously adding service areas on regular basis and serving around 5k + businesses. <o:p></o:p></span></p> <p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;line-height: 39.9pt;mso-outline-level:2\"><span style=\"font-size:12.0pt;font-family:\"Arial\",\"sans-serif\"; mso-fareast-font-family:\"Times New Roman\";color:#263F97;mso-fareast-language: EN-IN\">We ensure you the trusted service and end to end solutions of your all logistics needs.<o:p></o:p></span></p></h5></span>', 1, NULL